import { VFC } from 'react';
import { StyledWrapper, StyledOuter } from 'commonCSS/style'
import { Helmet, HelmetProvider } from 'react-helmet-async';
import HomeImage from 'img/HomeBackgroundImage.jpg';

const Home: VFC = () => {
    return (
        <HelmetProvider>
            <Helmet>
            <title>Home</title>
            </Helmet>
            <StyledOuter>
                <StyledWrapper>
                    <h1>Here is Home</h1>
                </StyledWrapper>
            </StyledOuter>
        </HelmetProvider>
    )
}

export default Home;
